export function init(){generator('[data-ext-fn="ext-qrcode"]')}function generator(e){let t;document.querySelectorAll(e).forEach((e=>{t=e.getAttribute("data-ext-text"),qrcode(e,t)}))}function qrcode(e,t,r=128){let n;return n={text:t,width:r,height:r,backgroundImage:"/img/icon.svg",backgroundImageAlpha:.3,drawer:"svg"},new QRCode(e,n)}